public class TestShapeV1 {

	public static void main(String[] args) {
		Shape s = new Shape(1, 2, 3, 4);
	    System.out.println("Shape is " + s);
	    Square sq = new Square(5, 6, 10);
	    System.out.println("Shape is " + sq);

	}

	class Shape
	{
	  private int left, top, width, height;
	  
	  public Shape(int x, int y, int w, int h) {
	    left = x; top = y; width = w; height = h;
	  }
	  
	  @Override public String toString() {
	    return "Shape(L:" + left + ",T:" + top + ",W:" + width + ",H:" + height + ")";
	  }
	}
	
	class Square extends Shape {
		  
		  public Square(int x, int y, int w) {
		    super(x, y, w, w);
		  }
		}
}

public class AccountBST {
	
	private Account root;
	private AccountBST left;
	private AccountBST right;
	
	public void insert(int key, float amount) {
		if(root == null) {
			AccountBST newNode = new AccountBST();
			Account newRoot = new Account();
			newRoot.setKey(key);
			newRoot.setBalance(amount);
			newNode.setRoot(newRoot);
		}
		
		if(key < root.getKey()) {
			
			AccountBST newNode = new AccountBST();
			Account newRoot = new Account();
			newRoot.setKey(key);
			newRoot.setBalance(amount);
			newNode.setRoot(newRoot);
			this.setLeft(newNode);
		}
		
if(key < root.getKey()) {
			
			AccountBST newNode = new AccountBST();
			Account newRoot = new Account();
			newRoot.setKey(key);
			newRoot.setBalance(amount);
			newNode.setRoot(newRoot);
			this.setLeft(newNode);
		}
	}

	public Account getRoot() {
		return root;
	}

	public void setRoot(Account root) {
		this.root = root;
	}

	public AccountBST getLeft() {
		return left;
	}

	public void setLeft(AccountBST left) {
		this.left = left;
	}

	public AccountBST getRight() {
		return right;
	}

	public void setRight(AccountBST right) {
		this.right = right;
	}

}
